- input: "TEXT\x1CC00161810\x1CTEXT-00001\x1C\x1CF3XA\x1CThe Committee is in receipt
    of the Commissions Request for Additional Information regarding in-kind contributions
    and transfers from Democracy for America and the DNC Services/Democratic National
    Committee.  1). Democracy for America informed the Committee that the in-kind
    information that was provided for 09/12/2012 in the amount of $463.73 was reported
    by them itemized vs. totaled.   The Committee has not been informed as to what
    that itemization was and is reporting it the way the in-kind letter stated.  2.)
    The $47,000.00 transfer was inadvertently reported from the DNC Services/Democratic
    National Committee in error.  The transfer was actually received from Obama for
    America.  This amended report reflects that change.  3.) The in-kind originally
    reported from the DNC Services/Democratic National Committee for Mobile Phones
    for $27,366.08 is being changed to $1,620.36 per an amended in-kind letter dated
    04/05/2013 from the DNC Services/Democratic National Committee.  All subsequent
    reports from the Committee are being amended to reflect these changes.  Please
    note that employees of the Committee that spent less than 25% of their time on
    Federal Election Activity were paid on the either Schedule H4 uniform split or
    Schedule B supporting line 21b; this includes benefits. - All fundraising activity
    was for the purpose of fundraising for the benefit of the Committee and was not
    attributable to any candidate for federal office.  - The transfer of the joint
    fundraising proceeds received during this reporting period from the New Mexico
    Senate Victory Fund, ASDC Dollars Democrats and/or the DNC Victory Fund Joint
    Fundraiser programs represents the committee's share of proceeds for contributions
    received during this or prior reporting periods. The memo entries for these contributions
    are included in this or a prior report of the committee. - No federal transfers
    were designated for exempt activity.\n"
